// Helper function to get songs by genre
export const getSongsByGenre = (genre: string) => {
  return songs.filter(song => song.genre.toLowerCase() === genre.toLowerCase());
};

// Helper function to get songs by mood
export const getSongsByMood = (mood: string) => {
  return songs.filter(song => song.mood.toLowerCase() === mood.toLowerCase());
};

// Helper function to get trending songs (most likes)
export const getTrendingSongs = () => {
  return [...songs].sort((a, b) => b.likes - a.likes);
};

// Helper function to get user history
export const getUserHistory = () => {
  return songs.filter(song => currentUser.history.includes(song.id));
};

// Helper function to get user liked songs
export const getUserLikedSongs = () => {
  return songs.filter(song => currentUser.likedSongs.includes(song.id));
};

// Helper function to search songs
export const searchSongs = (query: string) => {
  const lowerCaseQuery = query.toLowerCase();
  return songs.filter(song => 
    song.title.toLowerCase().includes(lowerCaseQuery) ||
    song.artist.toLowerCase().includes(lowerCaseQuery) ||
    song.genre.toLowerCase().includes(lowerCaseQuery) ||
    song.mood.toLowerCase().includes(lowerCaseQuery)
  );
};
